function Paginador({productList, pagination,setPagination}){

    return(
        <div className="pagination">
            {productList.length > 15 &&
                (pagination ? (
                    <>
                    <button onClick={()=>setPagination(!pagination)}>
                        Siguente <img src={next} alt="next"/>
                    </button>
                    </>
                ) : (
                    <button onClick={()=>setPagination(!pagination)}>
                        <img src={next} alt="prev"/>Anterior
                        </button>
            ))}
        </div>
    )

